import React, { Component } from "react";
import './Home.css';

export default class Home extends Component {
    componentDidMount() {
        var slideInterval = 5000; //5 seconds.
        startPlayback();

    }
    render() {
        return <div>
            <div id="carousel">
                <figure class="visible">
                    <img class="slideshow" src="./img/image1.jpeg" alt="img" />
                </figure>
                <figure class="hidden">
                    <img class="slideshow" src="./img/image4.jpg" alt="img" />
                </figure>
                <figure class="hidden">
                    <img class="slideshow" src="./img/image5.jpg" alt="img" />
                </figure>
            </div>

        </div>

    }
}
